import React, { useState } from "react";
import "./navBar.css";
function NavBar() {
  const [menuOpen, setMenuOpen] = useState(false); // Track menu state (open or closed). with the help of State mechanism

  // Toggle the menu open/close state

  return (
    <div>
      <nav className="navbar">
        <div className="data-container">
          <img
            src="https://i.ibb.co/kGbqdSB/NEW-2.png"
            className="Logo"
            alt="Logo"
          />
          <div
            className={`menu-data animate__animated ${
              menuOpen ? "animate__fadeIn" : "animate__fadeOut"
            }`}
          >
            <a onClick={() => setMenuOpen(!menuOpen)}>
              <i id="close" className="size fa-solid fa-xmark"></i>
            </a>
            <a href="">Home</a>
            <a href="">About Us</a>
            <a href="">Search</a>
            <a href="">Dropdown</a>
            <a href="">Chiku</a>
          </div>
          {/* created a state . with the help of this state the close function is performing  */}
          <a id="Menu-bar" onClick={() => setMenuOpen(!menuOpen)}>
            <i className="size-icon fa-solid fa-bars"></i>
          </a>
        </div>
      </nav>
    </div>
  );
}

export default NavBar;
